{
  "openapi": "3.0.0",
  "servers": [
    {
      "url": "https://circleci.com/api/v1"
    }
  ],
  "info": {
    "description": "The CircleCI API is a RESTful, fully-featured API that allows you to do almost anything in CircleCI.\nYou can access all information and trigger all actions.\nThe only thing we donâ€™t provide access to is billing functions, which must be done from the CircleCI web UI.\n",
    "license": {
      "name": "Attribution-NonCommercial-ShareAlike 4.0 International",
      "url": "http://creativecommons.org/licenses/by-nc-sa/4.0/"
    },
    "title": "CircleCI REST API",
    "version": "v1",
    "x-apisguru-categories": [
      "developer_tools"
    ],
    "x-logo": {
      "url": "https://api.apis.guru/v2/cache/logo/https_avatars0.githubusercontent.com_u_1231870.png"
    },
    "x-origin": [
      {
        "format": "openapi",
        "url": "https://raw.githubusercontent.com/kamikazechaser/spec-circleci/master/swagger.yml",
        "version": "3.0"
      }
    ],
    "x-providerName": "circleci.com",
    "x-unofficialSpec": true
  },
  "security": [
    {
      "apikey": []
    }
  ],
  "paths": {
    "/me": {
      "get": {
        "description": "Provides information about the signed in user.\n",
        "responses": {
          "200": {
            "content": {
              "application/json": {
                "schema": {
                  "properties": {
                    "admin": {
                      "type": "boolean",
                      "in": "RESPONSE_BODY"
                    },
                    "all_emails": {
                      "items": {
                        "format": "email",
                        "type": "string",
                        "in": "RESPONSE_BODY"
                      },
                      "type": "array",
                      "in": "RESPONSE_BODY"
                    },
                    "analytics_id": {
                      "type": "string",
                      "in": "RESPONSE_BODY"
                    },
                    "avatar_url": {
                      "format": "uri",
                      "type": "string",
                      "in": "RESPONSE_BODY"
                    },
                    "basic_email_prefs": {
                      "type": "string",
                      "in": "RESPONSE_BODY"
                    },
                    "bitbucket": {
                      "nullable": true,
                      "type": "integer",
                      "in": "RESPONSE_BODY"
                    },
                    "bitbucket_authorized": {
                      "type": "boolean",
                      "in": "RESPONSE_BODY"
                    },
                    "containers": {
                      "type": "integer",
                      "in": "RESPONSE_BODY"
                    },
                    "created_at": {
                      "format": "date-time",
                      "type": "string",
                      "in": "RESPONSE_BODY"
                    },
                    "days_left_in_trial": {
                      "type": "integer",
                      "in": "RESPONSE_BODY"
                    },
                    "dev_admin": {
                      "type": "boolean",
                      "in": "RESPONSE_BODY"
                    },
                    "enrolled_betas": {
                      "items": {
                        "type": "string",
                        "in": "RESPONSE_BODY"
                      },
                      "type": "array",
                      "in": "RESPONSE_BODY"
                    },
                    "github_id": {
                      "nullable": true,
                      "type": "integer",
                      "in": "RESPONSE_BODY"
                    },
                    "github_oauth_scopes": {
                      "items": {
                        "type": "string",
                        "in": "RESPONSE_BODY"
                      },
                      "type": "array",
                      "in": "RESPONSE_BODY"
                    },
                    "gravatar_id": {
                      "nullable": true,
                      "type": "integer",
                      "in": "RESPONSE_BODY"
                    },
                    "heroku_api_key": {
                      "nullable": true,
                      "type": "string",
                      "in": "RESPONSE_BODY"
                    },
                    "in_beta_program": {
                      "type": "boolean",
                      "in": "RESPONSE_BODY"
                    },
                    "login": {
                      "type": "string",
                      "in": "RESPONSE_BODY"
                    },
                    "name": {
                      "type": "string",
                      "in": "RESPONSE_BODY"
                    },
                    "organization_prefs": {
                      "type": "object",
                      "in": "RESPONSE_BODY"
                    },
                    "parallelism": {
                      "type": "integer",
                      "in": "RESPONSE_BODY"
                    },
                    "plan": {
                      "nullable": true,
                      "type": "string",
                      "in": "RESPONSE_BODY"
                    },
                    "projects": {
                      "type": "object",
                      "in": "RESPONSE_BODY"
                    },
                    "pusher_id": {
                      "type": "string",
                      "in": "RESPONSE_BODY"
                    },
                    "selected_email": {
                      "format": "email",
                      "type": "string",
                      "in": "RESPONSE_BODY"
                    },
                    "sign_in_count": {
                      "type": "integer",
                      "in": "RESPONSE_BODY"
                    },
                    "trial_end": {
                      "format": "date-time",
                      "type": "string",
                      "in": "RESPONSE_BODY"
                    }
                  },
                  "type": "object",
                  "x-schemaName": "User",
                  "required": true,
                  "in": "response_body"
                }
              }
            },
            "description": "signed in user"
          }
        }
      }
    },
    "/project/{username}/{project}": {
      "get": {
        "description": "Build summary for each of the last 30 builds for a single git repo.\n",
        "parameters": [
          {
            "description": "The number of builds to return. Maximum 100, defaults to 30.\n",
            "in": "query",
            "name": "limit",
            "schema": {
              "default": 30.0,
              "maximum": 100.0,
              "type": "integer"
            }
          },
          {
            "description": "The API returns builds starting from this offset, defaults to 0.\n",
            "in": "query",
            "name": "offset",
            "schema": {
              "default": 0.0,
              "type": "integer"
            }
          },
          {
            "description": "Restricts which builds are returned.\nSet to \"completed\", \"successful\", \"failed\", \"running\", or defaults to no filter.\n",
            "in": "query",
            "name": "filter",
            "schema": {
              "enum": [
                "completed",
                "successful",
                "failed",
                "running"
              ],
              "type": "string"
            }
          },
          {
            "description": "XXXXXXXXX\n",
            "in": "path",
            "name": "project",
            "required": true,
            "schema": {
              "type": "string"
            }
          },
          {
            "description": "XXXXXXXXX\n",
            "in": "path",
            "name": "username",
            "required": true,
            "schema": {
              "type": "string"
            }
          }
        ],
        "responses": {
          "200": {
            "content": {
              "application/json": {
                "schema": {
                  "items": {
                    "properties": {
                      "body": {
                        "description": "commit message body",
                        "type": "string",
                        "in": "RESPONSE_BODY"
                      },
                      "branch": {
                        "type": "string",
                        "in": "RESPONSE_BODY"
                      },
                      "build_time_millis": {
                        "type": "integer",
                        "in": "RESPONSE_BODY"
                      },
                      "build_url": {
                        "format": "uri",
                        "type": "string",
                        "in": "RESPONSE_BODY"
                      },
                      "committer_email": {
                        "format": "email",
                        "type": "string",
                        "in": "RESPONSE_BODY"
                      },
                      "committer_name": {
                        "type": "string",
                        "in": "RESPONSE_BODY"
                      },
                      "dont_build": {
                        "description": "reason why we didn\u0027t build, if we didn\u0027t build",
                        "nullable": true,
                        "type": "string",
                        "in": "RESPONSE_BODY"
                      },
                      "lifecycle": {
                        "enum": [
                          "queued",
                          "scheduled",
                          "not_run",
                          "not_running",
                          "running",
                          "finished"
                        ],
                        "type": "string",
                        "x-schemaName": "Lifecycle",
                        "in": "RESPONSE_BODY"
                      },
                      "previous": {
                        "description": "previous build",
                        "properties": {
                          "build_num": {
                            "type": "integer",
                            "in": "RESPONSE_BODY"
                          },
                          "build_time_millis": {
                            "type": "integer",
                            "in": "RESPONSE_BODY"
                          },
                          "status": {
                            "enum": [
                              "retried",
                              "canceled",
                              "infrastructure_fail",
                              "timedout",
                              "not_run",
                              "running",
                              "failed",
                              "queued",
                              "scheduled",
                              "not_running",
                              "no_tests",
                              "fixed",
                              "success"
                            ],
                            "type": "string",
                            "x-schemaName": "Status",
                            "in": "RESPONSE_BODY"
                          }
                        },
                        "type": "object",
                        "x-schemaName": "PreviousBuild",
                        "in": "RESPONSE_BODY"
                      },
                      "queued_at": {
                        "description": "time build was queued",
                        "format": "date-time",
                        "type": "string",
                        "in": "RESPONSE_BODY"
                      },
                      "reponame": {
                        "type": "string",
                        "in": "RESPONSE_BODY"
                      },
                      "retry_of": {
                        "description": "build_num of the build this is a retry of",
                        "nullable": true,
                        "type": "integer",
                        "in": "RESPONSE_BODY"
                      },
                      "start_time": {
                        "description": "time build started",
                        "format": "date-time",
                        "type": "string",
                        "in": "RESPONSE_BODY"
                      },
                      "stop_time": {
                        "description": "time build finished",
                        "format": "date-time",
                        "type": "string",
                        "in": "RESPONSE_BODY"
                      },
                      "subject": {
                        "type": "string",
                        "in": "RESPONSE_BODY"
                      },
                      "username": {
                        "type": "string",
                        "in": "RESPONSE_BODY"
                      },
                      "vcs_url": {
                        "format": "uri",
                        "type": "string",
                        "in": "RESPONSE_BODY"
                      },
                      "why": {
                        "description": "short string explaining the reason we built",
                        "type": "string",
                        "in": "RESPONSE_BODY"
                      }
                    },
                    "type": "object",
                    "x-schemaName": "Build",
                    "in": "RESPONSE_BODY"
                  },
                  "type": "array",
                  "x-schemaName": "Builds",
                  "required": true,
                  "in": "response_body"
                }
              }
            },
            "description": "Build summary for each of the last 30 builds"
          }
        }
      },
      "post": {
        "description": "Triggers a new build, returns a summary of the build.\n",
        "requestBody": {
          "content": {
            "application/json": {
              "schema": {
                "properties": {
                  "build_parameters": {
                    "description": "Additional environment variables to inject into the build environment. A map of names to values.\n",
                    "type": "object",
                    "x-schemaName": "BuildParameters",
                    "in": "REQUEST_BODY"
                  },
                  "parallel": {
                    "description": "The number of containers to use to run the build. Default is null and the project default is used.\n",
                    "type": "string",
                    "x-schemaName": "Parallel",
                    "in": "REQUEST_BODY"
                  },
                  "revision": {
                    "description": "The specific revision to build.\nDefault is null and the head of the branch is used. Cannot be used with tag parameter.\n",
                    "type": "string",
                    "x-schemaName": "Revision",
                    "in": "REQUEST_BODY"
                  },
                  "tag": {
                    "description": "The tag to build. Default is null. Cannot be used with revision parameter.\n",
                    "type": "string",
                    "x-schemaName": "Tag",
                    "in": "REQUEST_BODY"
                  }
                },
                "type": "object",
                "in": "request_body"
              }
            }
          },
          "required": false
        },
        "responses": {
          "201": {
            "content": {
              "application/json": {
                "schema": {
                  "properties": {
                    "added_at": {
                      "format": "date-time",
                      "type": "string",
                      "in": "RESPONSE_BODY"
                    },
                    "build_num": {
                      "type": "integer",
                      "in": "RESPONSE_BODY"
                    },
                    "outcome": {
                      "enum": [
                        "canceled",
                        "infrastructure_fail",
                        "timedout",
                        "failed",
                        "no_tests",
                        "success"
                      ],
                      "type": "string",
                      "x-schemaName": "Outcome",
                      "in": "RESPONSE_BODY"
                    },
                    "pushed_at": {
                      "format": "date-time",
                      "type": "string",
                      "in": "RESPONSE_BODY"
                    },
                    "status": {
                      "enum": [
                        "retried",
                        "canceled",
                        "infrastructure_fail",
                        "timedout",
                        "not_run",
                        "running",
                        "failed",
                        "queued",
                        "scheduled",
                        "not_running",
                        "no_tests",
                        "fixed",
                        "success"
                      ],
                      "type": "string",
                      "x-schemaName": "Status",
                      "in": "RESPONSE_BODY"
                    },
                    "vcs_revision": {
                      "type": "string",
                      "x-schemaName": "Sha1",
                      "in": "RESPONSE_BODY"
                    }
                  },
                  "type": "object",
                  "x-schemaName": "BuildSummary",
                  "required": true,
                  "in": "response_body"
                }
              }
            },
            "description": "returns a summary of the build"
          }
        },
        "parameters": [
          {
            "description": "XXXXXXXXX\n",
            "in": "path",
            "name": "project",
            "required": true,
            "schema": {
              "type": "string"
            }
          },
          {
            "description": "XXXXXXXXX\n",
            "in": "path",
            "name": "username",
            "required": true,
            "schema": {
              "type": "string"
            }
          }
        ]
      }
    },
    "/project/{username}/{project}/build-cache": {
      "delete": {
        "description": "Clears the cache for a project.\n",
        "responses": {
          "200": {
            "content": {
              "application/json": {
                "schema": {
                  "properties": {
                    "status": {
                      "type": "string",
                      "in": "RESPONSE_BODY"
                    }
                  },
                  "type": "object",
                  "required": true,
                  "in": "response_body"
                }
              }
            },
            "description": "status message"
