            "schema": {
              "type": "string"
            }
          },
          {
            "description": "XXXXXXXXX\n",
            "in": "path",
            "name": "username",
            "required": true,
            "schema": {
              "type": "string"
            }
          }
        ]
      }
    },
    "/project/{username}/{project}/checkout-key": {
      "get": {
        "description": "Lists checkout keys.\n",
        "responses": {
          "200": {
            "content": {
              "application/json": {
                "schema": {
                  "items": {
                    "properties": {
                      "fingerprint": {
