                      "preferred": {
                        "type": "boolean",
                        "in": "RESPONSE_BODY"
                      },
                      "public_key": {
                        "type": "string",
                        "in": "RESPONSE_BODY"
                      },
                      "time": {
                        "description": "when the key was issued",
                        "format": "date-time",
                        "type": "string",
                        "in": "RESPONSE_BODY"
                      },
                      "type": {
                        "description": "can be \"deploy-key\" or \"github-user-key\"\n",
                        "enum": [
                          "deploy-key",
                          "github-user-key"
                        ],
                        "type": "string",
                        "in": "RESPONSE_BODY"
                      }
                    },
                    "type": "object",
                    "x-schemaName": "Key",
                    "in": "RESPONSE_BODY"
                  },
                  "type": "array",
                  "x-schemaName": "Keys",
                  "required": true,
                  "in": "response_body"
                }
              }
            },
            "description": "checkout keys"
          }
        },
        "parameters": [
          {
            "description": "XXXXXXXXX\n",
            "in": "path",
            "name": "project",
            "required": true,
            "schema": {
              "type": "string"
            }
