          "description": "The type of key to create. Can be \u0027deploy-key\u0027 or \u0027github-user-key\u0027.\n",
          "required": false
        },
        "responses": {
          "200": {
            "content": {
              "application/json": {
                "schema": {
                  "properties": {
                    "fingerprint": {
                      "type": "string",
                      "in": "RESPONSE_BODY"
                    },
                    "preferred": {
                      "type": "boolean",
                      "in": "RESPONSE_BODY"
