                    "type": {
                      "description": "can be \"deploy-key\" or \"github-user-key\"\n",
                      "enum": [
                        "deploy-key",
                        "github-user-key"
                      ],
                      "type": "string",
                      "in": "RESPONSE_BODY"
                    }
                  },
                  "type": "object",
                  "x-schemaName": "Key",
                  "required": true,
                  "in": "response_body"
                }
              }
            },
            "description": "checkout key"
          }
        },
        "parameters": [
